import React from 'react'
import { useState,useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import AdminService from '../../services/AdminService';
// import ListPlanComponent from './components/AdminComponents/ListPlanComponent';

export default function ListPlanComponent() {
  const [travelplans, setTravelPlans] = useState([]);
  const navigate = useNavigate();

  const addPlan = () => {
    navigate('/add-plan/-1');
  };
  const deletePlan = (id)=>{
    // navigate(`/`);
    AdminService.deletePlan(id).then(res=>{
      setTravelPlans((prevPlans) =>
      prevPlans.filter((travelplans) => travelplans.id !== id)
    );

    })
  }
  const editPlan = (id)=>{
    navigate(`/add-plan/${id}`);
  }
  const viewPlan = (id)=>{
    navigate(`/view-plan/${id}`);
  }

  useEffect(() => {
    const fetchData = () => {
      AdminService.getAllPlans()
        .then((response) => {
          setTravelPlans(response.data);
        })
        .catch((error) => {
          console.error('Error fetching data:', error);
        });
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2 className='text-center'>Travel Plans</h2>
      <div className="row">
        <button className="btn btn-primary"  >
          Add Plan
        </button>
      </div>
      <div className="row">
        <table className='table table-striped table-bordered'>
          <thead>
            <tr>
              <th>Origin</th>
              <th>Destination</th>
              <th>Start Date</th>
              <th>End Date</th>
              <th>Budget</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {travelplans.map((travelPlan) => (
              <tr key={travelPlan.id}>
                <td>{travelPlan.origin}</td>
                <td>{travelPlan.destination}</td>
                <td>{travelPlan.startDate}</td>
                <td>{travelPlan.endDate}</td>
                <td>{travelPlan.budget}</td>
                <td>
                  <button className='btn btn-info'>Update</button>
                  <button className='btn btn-danger' style={{marginLeft:"10px"}}>Delete</button>
                  <button className='btn btn-info' style={{marginLeft:"10px"}}>View</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  )
}
